import axios from 'axios';
import createTodoContainer from '../../containers/createTodo.container';

const submit = (event) => {
    event.preventDefault();

    const newTodo = {
        todoDescription: createTodoContainer.mapStateToProps.todoDescription,
        todoResponsible: createTodoContainer.mapStateToProps.todoResponsible,
        todoPriority: createTodoContainer.mapStateToProps.todoPriority,
        todoCompleted: createTodoContainer.mapStateToProps.todoCompleted,
    }

    return {type: 'submit', newTodo}
}

export default submit;
